// CreateMember.js
import React, { useState } from 'react';
import axios from 'axios';

const CreateMember = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    category: '',
    level: '',
    age_group: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:8000/members/', formData);
      alert('Member created successfully');
    } catch (error) {
      console.error('There was an error creating the member!', error);
    }
  };

  return (
    <div>
      <h2>Create Member</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Name:</label>
          <input type="text" name="name" value={formData.name} onChange={handleChange} required />
        </div>
        <div>
          <label>Email:</label>
          <input type="email" name="email" value={formData.email} onChange={handleChange} required />
        </div>
        <div>
          <label>Category:</label>
          <input type="text" name="category" value={formData.category} onChange={handleChange} required />
        </div>
        <div>
          <label>Level:</label>
          <input type="text" name="level" value={formData.level} onChange={handleChange} required />
        </div>
        <div>
          <label>Age Group:</label>
          <input type="text" name="age_group" value={formData.age_group} onChange={handleChange} required />
        </div>
        <button type="submit">Create Member</button>
      </form>
    </div>
  );
}

export default CreateMember;
